using DevExpress.Data.Filtering;
using DevExpress.ExpressApp;
using DevExpress.ExpressApp.DC;
using DevExpress.ExpressApp.Model;
using DevExpress.Persistent.Base;
using DevExpress.Persistent.BaseImpl;
using DevExpress.Persistent.Validation;
using DevExpress.Xpo;
using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Linq;
using System.Text;

namespace Tesoreria.Module.NotMapped
{
    [DomainComponent]
    public class DC_SubirArchivo
    {
        public DC_SubirArchivo()
        {
            string base64String2 = "";
            byte[] fileBytes = Convert.FromBase64String(base64String2);
            using (var memoryStream = new System.IO.MemoryStream(fileBytes))
            {
                this.Archivo = new FileData(new Session()); this.Archivo.LoadFromStream("subirExcelPlantilla.xlsx", memoryStream);
            }
        }
        [XafDisplayName("Selecciona el archivo Excel")]
        [RuleRequiredField(DefaultContexts.Save)]
        public FileData Archivo { get; set; }
    }
}